import React, { useState } from "react";
import { useRef, useEffect } from "react";
import emailjs from 'emailjs-com';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Image from 'react-bootstrap/Image';
import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import Badge from 'react-bootstrap/Badge';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import Button from 'react-bootstrap/Button';
import ListGroup from 'react-bootstrap/ListGroup';
import "./App.css";
import { motion } from "framer-motion";


function App() {

  const [isIntersecting, setIsIntersecting] = useState(false);
  const ref = useRef(null);


  function sendEmail(e) {
    e.preventDefault();    //This is important, i'm not sure why, but the email won't send without it

    emailjs.sendForm('service_8y585qi', 'template_rlv171e', e.target, 'LS0KcXi3uPgexxbgJ')
      .then((result) => {
        window.location.reload()  //This is if you still want the page to reload (since e.preventDefault() cancelled that behavior) 
      }, (error) => {
        console.log(error.text);
      });
  }

  const [formData, setFormData] = useState({
    username: "",
    password: "",
    errors: {},
    loading: false,
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevState) => ({ ...prevState, [name]: value }));
  };

  const validateForm = () => {
    const errors = {};

    // Check if username is empty
    if (!formData.username) {
      errors.username = "Username is required";
    }

    // Check if password is empty
    if (!formData.password) {
      errors.password = "Password is required";
    }

    setFormData((prevState) => ({ ...prevState, errors }));
    // Return true if there are no errors
    return Object.keys(errors).length === 0;
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    setFormData({
      ...formData,
      loading: true,
    });

    // Simulate form submission delay
    setTimeout(() => {
      console.log(formData);
      setFormData({
        ...formData,
        loading: false,
      });
    }, 2000);
  };

  const divStyle = {
    width: '100vw',
    //background-size: cover,
    backgroundPosition: 'center',
    height: 500,
    //flex: 1,
    //width: null
    //width: '88%',
    //height: '800px',
    //backgroundImage: `url(${imgMyimageexample})`,
    //backgroundSize: 'cover'   <---- This is important
  };


  function getStars(rating) {
    const stars = [];
    for (let i = 0; i < 5; i++) {
      if (rating - 1 < i) {
        stars.push(<span>☆</span>);
      } else {
        stars.push(<span>★</span>);
      }
    }
    return stars;
  }

  const RATING_DATA = [
    { name: 'Manga1', rating: 1, comment: 'It is good' },
    { name: 'Manga2', rating: 4, comment: 'It is great' },
    { name: 'Manga3', rating: 5, comment: 'It is fantastic' },
    { name: 'Manga4', rating: 0, comment: 'It is brilliant' },
    { name: 'Manga5', rating: 2, comment: 'It is bravo' },
  ];

  const scrollRef = useRef(null)
  /*const transition = {
    delay: 0.2
  }*/
  return (
    <>
      <div className="MainContainer">
        <Navbar bg="" style={{ backgroundColor: '#253037' }} data-bs-theme="dark" sticky="top">
          <Container>
            <Navbar.Brand href="#home"><img src={"logo2.png"} /></Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end"></Navbar.Collapse>
            <Nav className="me-auto">
              <Nav.Link href="#services" style={{ paddingRight: '2.5rem' }}><h4>SERVICES</h4></Nav.Link>
              <Nav.Link href="#reviews" style={{ paddingRight: '2.5rem' }}><h4>REVIEWS</h4></Nav.Link>
              <Nav.Link href="#contact" style={{ paddingRight: '2.5rem' }}><h4>CONTACT US</h4></Nav.Link>
            </Nav>
          </Container>
        </Navbar>

        <div>
          <Image src={"building7.png"} style={divStyle} fluid />
          <br /><br />
        </div>


        <div id='services'>
          <CardGroup className="CardFormatting">
            <Card.Header style={{ marginTop: '1rem', marginBottom: '1rem' }}><h2>Services</h2></Card.Header>
          </CardGroup>
          <CardGroup className="CardFormatting">
            <Badge bg="" style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Real Estate</Badge>

            <Badge bg="" style={{ backgroundColor: '#6cb7ab', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Overseas Money Transfer</Badge>

            <Badge bg="" style={{ backgroundColor: '#1a9ae3', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>CAR Financing</Badge>

            <Badge bg="" style={{ backgroundColor: '#915c83', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Income Tax</Badge>

          </CardGroup>
          <CardGroup className="CardFormatting">

            <Badge bg="" style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Real Estate</Badge>

            <Badge bg="" style={{ backgroundColor: '#6cb7ab', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Overseas Money Transfer</Badge>

            <Badge bg="" style={{ backgroundColor: '#1a9ae3', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>CAR Financing</Badge>

            <Badge bg="" style={{ backgroundColor: '#915c83', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Income Tax</Badge>

          </CardGroup>
          <CardGroup className="CardFormatting">

            <Badge bg="" style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Real Estate</Badge>

            <Badge bg="" style={{ backgroundColor: '#6cb7ab', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Overseas Money Transfer</Badge>

            <Badge bg="" style={{ backgroundColor: '#1a9ae3', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>CAR Financing</Badge>

            <Badge bg="" style={{ backgroundColor: '#915c83', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem', paddingRight: '3rem', paddingLeft: '3rem', paddingTop: '1rem', paddingBottom: '1rem', fontSize: 20 }}>Income Tax</Badge>

          </CardGroup>
        </div>

        <br />
        <div id='reviews'>
          <CardGroup className="CardFormatting">
            <Card.Header style={{ marginTop: '1rem', marginBottom: '1rem' }}><h2>What our customers think?</h2></Card.Header>
          </CardGroup>

          <CardGroup className="CardFormatting">

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

          </CardGroup>

          <CardGroup className="CardFormatting">

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

            <Card style={{ backgroundColor: '#b76e79', marginRight: '3rem', marginLeft: '3rem', marginTop: '1rem', marginBottom: '1rem'}}>
              <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
              </Card.Text>
              <Card.Text>
                <Badge bg="" style={{ backgroundColor: '#b76e79' }} pill>
                  {getStars(5)}
                </Badge>
              </Card.Text>
            </Card>

          </CardGroup>


        </div>


        <div id='contact'>
          <Card className="CardFormattingContact" >
            <Card.Header><h2>Let's connect!</h2></Card.Header>
            <Card.Body>
              <div className="contact" style={{ color: 'white', fontSize: '18px' }}>
                <Button variant="" style={{ backgroundColor: '#b76e79', color: 'white', fontSize: '18px' }} className='contactButtons' onClick={() => window.location = 'mailto:patel.accounting@gmail.com'}>
                  Send an Email</Button>
              </div>
              <br />
              <p className="contact" style={{ marginRight: '1.0rem', marginLeft: '1.0rem', color: 'white', fontSize: '13px' }}>
                Or reach out to us through - </p>
              <h6 className="contact" style={{ marginRight: '1.0rem', marginLeft: '1.0rem', color: 'white' }}>
                Tel No : +1 (647) 717-9611</h6>
              <h6 className="contact" style={{ marginRight: '1.0rem', marginLeft: '1.0rem', color: 'white' }}>
                Email : patel.accounting@gmail.com</h6>

            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}
export default App;
